//****************************************************************************
// FUNCTION DECLARATIONS
//****************************************************************************
bit ScalerQCPanelUniformityTest(void);

//--------------------------------------------------
// Description  : Test PanelUniformity
// Input Value  : None
// Output Value : _TEST_PASS or _TEST_FAIL
//--------------------------------------------------
bit ScalerQCPanelUniformityTest(void)
{
    BYTE ucData = 0;

    DebugMessageQC("5. PanelUniformity Start", 0x00);

    ScalerQCDDomainRandomGenOn(_MASS, _BIT_MODE_12);

    // Panel Uniformity Initial
    ScalerSetByte(P34_02_UN_GAIN_LUT_HOR_GRIDS, 0x3E); // (3840/64)+2 = 62
    ScalerSetByte(P34_03_UN_GAIN_LUT_VER_GRIDS, 0x23); // (2160/64)+2 = 35
    ScalerSetByte(P34_04_UN_GAIN_LUT_HOR_OFFSET, 0x20); // Hoffset = 32
    ScalerSetByte(P34_05_UN_GAIN_LUT_VER_OFFSET, 0x08); // Voffset = 8


    // 0. 1-level Uniformity without offset
    ScalerSetByte(P34_01_UN_MULTI_LUT_CTRL, 0x00); // 1 level
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2C); // interval 64, open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0xA8);    // eanble uniformity and close access port

    DebugMessageQC("5. UniformityMode_0", 0x00);
    ucData = (BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _D_CRC_AFTER_DDITHER, _M1|_M2, tUniformityTest0_DCRCTable, 1);


    // 1. 1-level Uniformity with offset
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2C); // disable uniformity and open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_OFFSET_LUT, sizeof(tQC_PANEL_UNIFORMITY_OFFSET_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x28); // close access port
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2C);    // disable uniformity and open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_DECAY_LUT, sizeof(tQC_PANEL_UNIFORMITY_DECAY_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0xA9);    // eanble uniformity+offset and close access port

    DebugMessageQC("5. UniformityMode_1", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _D_CRC_AFTER_DDITHER, _M1|_M2, tUniformityTest1_DCRCTable, 1) << 1));


    // 2. 4-level Uniformity without offset
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x28); // disable uniformity and close access port
    ScalerQCWaitForIDDomainEvent(_EVENT_DVS, _INPUT_PATH_ALL);
    ScalerSetByte(P34_01_UN_MULTI_LUT_CTRL, 0x02); // 4 level
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2C); // disable uniformity and open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0xA8);    // eanble uniformity and close access port

    DebugMessageQC("5. UniformityMode_2", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _D_CRC_AFTER_DDITHER, _M1|_M2, tUniformityTest2_DCRCTable, 1) << 2));

    ScalerSetBit(P0_68_GAMMA_BIST_DITHER_SETA, ~(_BIT6|_BIT5), _BIT6|_BIT5);
    // 3. PCM Mode of Uniformity + 1-level Uniformity
    ScalerSetByte(P34_01_UN_MULTI_LUT_CTRL, 0x00); // 1 level
    ScalerBurstWrite(tPCM_UNIFORMITY, sizeof(tPCM_UNIFORMITY), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2C); // disable uniformity and open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0xAA);    // eanble uniformity PCM Mode and close access port

    DebugMessageQC("5. UniformityMode_3", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _D_CRC_AFTER_DDITHER, _M1|_M2, tUniformityTest3_DCRCTable, 1) << 3));


     ScalerQCHighlightWindowOn(); // Highlight Window On


    // 4. PCM Mode of Uniformity + 1-level Uniformity HLW Inside
    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0F_HLW_CONTROL2, ~_BIT6, _BIT6);
    DebugMessageQC("5. UniformityMode_4", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _D_CRC_AFTER_DDITHER, _M1|_M2, tUniformityTest4_DCRCTable, 1) << 4));
    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0F_HLW_CONTROL2, ~_BIT6, 0x00);


    // 5. PCM Mode of Uniformity + 1-level Uniformity HLW Outside
     ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2F); // disable uniformity and open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_OFFSET_LUT, sizeof(tQC_PANEL_UNIFORMITY_OFFSET_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0xAB);    // eanble uniformity PCM Mode and close access port

    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0F_HLW_CONTROL2, ~_BIT7, _BIT7);
    DebugMessageQC("5. UniformityMode_5", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _D_CRC_AFTER_DDITHER, _M1|_M2, tUniformityTest5_DCRCTable, 1) << 5));
    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0F_HLW_CONTROL2, ~_BIT7, 0x00);


     // 6. PCM Mode of Uniformity + 1-level Uniformity HLW byPass
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x22);    // eanble uniformity+offset and close access port
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2C); // disable uniformity and open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_GAIN_LUT, sizeof(tQC_PANEL_UNIFORMITY_GAIN_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x28); // disable uniformity and close access port
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x2C); // disable uniformity and open access port
    ScalerBurstWrite(tQC_PANEL_UNIFORMITY_OFFSET_LUT, sizeof(tQC_PANEL_UNIFORMITY_OFFSET_LUT), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0xAA);    // eanble uniformity PCM Mode and close access port

    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0F_HLW_CONTROL2, ~(_BIT7 | _BIT6), (_BIT7 | _BIT6));
    DebugMessageQC("5. UniformityMode_6", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _D_CRC_AFTER_DDITHER, _M1|_M2, tUniformityTest6_DCRCTable, 1) << 6));
    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0F_HLW_CONTROL2, ~(_BIT7 | _BIT6), 0x00);

     // Disable Color Function
    ScalerQCHighlightWindowOff(); // Disable HLW
    ScalerSetBit(P9_A1_INPUT_GAMMA_CTRL_SETA, ~_BIT6, 0x00); // Disable Input Gamma
    ScalerSetBit(P0_62_SRGB_CTRL, ~_BIT2, 0x00); // Disable Srgb
    ScalerSetBit(P0_67_GAMMA_CTRL_SETA, ~_BIT6, 0x00); // Disable Output Gamma
    ScalerQCDDomainPatternGenOff(); // Disable D Domain Pattern Gen
    ScalerSetByte(P34_00_UN_GLOBAL_CTRL, 0x28); // Disable Panel Uniformity

    DebugMessageQC("5. Panel Uniformity End", 0x00);

    if(ucData == 0x00)
    {
        DebugMessageQC("6. Panel Uniformity PASS", 0x00);
        return _TEST_PASS;
    }
    else
    {
        DebugMessageQC("6. Fail Mode", ucData);
        DebugMessageQC("6. Panel Uniformity FAIL", 0x00);
        return _TEST_FAIL;
    }
}

